import React from 'react';

function TomatoIcon() {
  return (
    <svg
      width="60"
      height="60"
      viewBox="0 0 100 100"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      className="opacity-20"
    >
      {/* Tomato body */}
      <circle cx="50" cy="60" r="40" fill="#FF6347" />

      {/* Tomato stem */}
      <path
        d="M50 20C50 20 30 20 30 10C30 0 50 5 50 5C50 5 70 0 70 10C70 20 50 20 50 20Z"
        fill="#228B22"
      />

      {/* Tomato leaf left */}
      <path
        d="M30 15C30 15 20 15 15 5C10 -5 30 5 30 15Z"
        fill="#228B22"
      />

      {/* Tomato leaf right */}
      <path
        d="M70 15C70 15 80 15 85 5C90 -5 70 5 70 15Z"
        fill="#228B22"
      />
    </svg>
  );
}

export default TomatoIcon;
